import React, { useState } from "react";
import Chart from "./Component/Chart";
import Navbar from "./Component/Navbar";
import Overview from "./Component/Overview";
import Table from "./Component/Table";

const App = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [quoteSummary, setQuoteSummary] = useState("");
  const [quoteSpark, setQuoteSpark] = useState("");
  const [rangeChart, setRangeChart] = useState("1mo");

  console.log("quoteSummary", quoteSummary);

  return (
    <div className="container">
      <Navbar
        setQuoteSummary={setQuoteSummary}
        setQuoteSpark={setQuoteSpark}
        rangeChart={rangeChart}
        quoteSummary={quoteSummary}
      />
      <Overview quoteSummary={quoteSummary} />
      <Chart quoteSpark={quoteSpark} setRangeChart={setRangeChart} />
      <Table quoteSummary={quoteSummary} />
    </div>
  );
};

export default App;
